import React from "react";
import "./contact.css"
import swt from './swt.png';

const Contact =() =>{
    return(
        <div className="contactMain">
        <div className="subcon">
         <img className="pos" src={swt}  alt="Logo" />
         <h1>Contact Us</h1>
        </div>
        </div>
    );
}
export default Contact;
